    .into_grouping_map_by(|&n| n % 3)
    .fold_first(|acc, _key, val| acc + val);

assert_eq!(lookup[&0], 3 + 6);
assert_eq!(lookup[&1], 1 + 4 + 7);
assert_eq!(lookup[&2], 2 + 5);
assert_eq!(lookup.len(), 3);
```

